import React, { Component, Fragment } from 'react'
import './Cards.css'


export default class Cards extends Component {
    render() {
        return (
            <Fragment>

                <div className='wrapper'>
                    <div className='card-col-left bg-col-one'>
                    </div>
                    <div className='card-col-right'>
                    <h3 className='color-white'>{this.props.values.TwoColCardHead}</h3>
                        <p className='color-white card-dis'>{this.props.values.TwoColCardDis}</p>

                    </div>
            </div>
            </Fragment>
        )
    }
}
